import React from "react";
import "./HomePage.css";
import Header from "../components/Header";
import SideBar from "../components/SideBar";

function HomePage() {
  return (
    <div className="app">
      <Header />
      <div className="app-page">
        <SideBar />
        {/* <Recommended /> */}
      </div>
    </div>
  );
}

export default HomePage;
